function set_package_prices(package_id) {

    var price = package_prices[package_id]['price'] * 1,
        old_price = package_prices[package_id]['old_price'] * 1,
        shipment_price = package_prices[package_id]['shipment_price'] * 1;

    $('.js_new_price').each(function() {
      $(this).is('input') ? $(this).val(price) : $(this).text(price);
    });

    $('.js_old_price').each(function() {
      $(this).is('input') ? $(this).val(old_price) : $(this).text(old_price);
    });

    $('.js_full_price').each(function() {
      $(this).is('input') ? $(this).val(price + shipment_price) : $(this).text(price + shipment_price);
    });

    $('.js_delivery_price').each(function() {
      $(this).is('input') ? $(this).val(shipment_price) : $(this).text(shipment_price);
    });

  	$('input[name=price]').each(function() {
      $(this).val(price);
    });
    $('input[name=shipment_price]').each(function() {
      $(this).val(shipment_price);
    });
  	$('input[name=total_price]').each(function() {
      $(this).val(price + shipment_price);
    });
  	$('input[name=total_price_wo_shipping]').each(function() {
      $(this).val(price);
    });

  	$('input[name=package_id]').val(package_id);
}

function checkTimeZone() {
    var offset = new Date().getTimezoneOffset();
    hours = offset / (-60);
    $('form').append('<input type="hidden" name="time_zone" value="'+hours+'">');
}

function setBrowser() {

    if (typeof ua !== 'undefined') {
        $('form').append('<input type="hidden" name="bw" value="'+ua.browser.name+'">');
    }

}

function sendPhoneOrder(form){
    form_data = $(form).serializeArray();
    form_data.push({"name" : "uri_params", "value" : window.location.search.replace("?", "")});
    $.ajax({
        type: "POST",
        url: "/order/create/",
        data: form_data,
        crossDomain: true,
        dataType: "json",
        success: function (e){
        }
    });
}

function cancelEvent(e){
    try {
        if (e) {
            e.returnValue = defaults.get_locale_var('exit_text');
            e.cancelBubble = true;
            if (e.stopPropagation)
                e.stopPropagation();
            if (e.preventDefault)
                e.preventDefault();
        }
    } catch (err) {}
    return defaults.get_locale_var('exit_text');
}

function RemoveUnload() {
    window.onbeforeunload = null;
}

function showLoader(){
 	var loaderDiv = document.createElement('div');
 	loaderDiv.id = 'loader-block';
	loaderDiv.className = 'loader-block';
	document.getElementsByTagName('body')[0].appendChild(loaderDiv);
	var ImgUrl = '/!common_files/images/loader.gif'
	var cssValues = {
		"position" : "fixed",
		"top" : 0,
		"left" : 0,
		"z-index" : 9999,
		"width" : "100%",
		"height" : "100%",
		"background" : 'url('+ImgUrl+') center center rgba(0,0,0,0.5) no-repeat' 
		
	}
	$('#loader-block').css(cssValues);
	$('#loader-block').animate({'opacity' : 0}, 20000, function(){
      hideLoader();
    });
}

function hideLoader(){
  var loader = $('#loader-block');
  loader.remove()
}

'use strict';
var REQUIRED_FIELDS = ['phone', 'name', 'address', 'postal_code', 'prefecture', 'city'],
    SEND_URL = '/order/create_temporary/',
    NO_AUTOSAVE_FIELD = 'no_autosave_orders',
    TIMEOUT_PERIOD = 3000,
    sender = function () {
            saver.data.forEach(function (form_element) {
                var is_valid = true;
                for (var key in form_element.required) {
                    if(form_element.required.hasOwnProperty(key) && !form_element.required[key].is_valid) {
                        is_valid = false;
                        break
                    } else {
                        form_element.form[key] = form_element.required[key].value
                    }
                }
                if (is_valid) {
                    console.log('new request');
                    $.post(SEND_URL, form_element.form, function (data) {
                        if (data.status !== 'ok')
                            console.log('Error during creating temporary order, error: ' + data.message)
                    }, 'json')
                }
            })
    },
    timeout = function () {
            var timeoutHandler,
                resetTimeout = function () {
                    clearTimeout(timeoutHandler);
                    timeoutHandler = setTimeout(sender, TIMEOUT_PERIOD);
                };
            return function () {
                resetTimeout()
            }
    },
    timeoutResetter = timeout(),
    saver = {
        data: [],
        listener: function (event) {
            var element = event.target;
            saver.data.forEach(function (form_entity, i) {
              	if(form_entity.required[element.name]){
                  	if (form_entity.required[element.name].value !== element.value && element.value !== form_entity.required[element.name].placeholder) {
                    	saver.data[i].required[element.name].value = element.value;
                    	saver.data[i].required[element.name].is_valid = true;
                    	timeoutResetter()
                	}
                }
                
            })
        },
        init: function () {
            var form = $('form');
            if (form.length) {
                for (var i = 0; i < form.length; i++) {
                    var cur_form = form[i],
                        form_fields = {form: {}, required: {}};
                    for (var k = 0; k < cur_form.elements.length; k++){
                        var el = cur_form.elements[k];
                      	if (el.name === NO_AUTOSAVE_FIELD && el.value == 1)
                          return
                        form_fields.form[el.name] = el.value
                    }

                    form_fields.form.user_agent = navigator.userAgent;

                    REQUIRED_FIELDS.forEach(function (fieldname) {
                        var field = cur_form.elements[fieldname];
                        if (field !== undefined && field.style.display !== 'none' && field.type !== 'hidden') {
                            $(field).on('keyup', saver.listener);
                            form_fields.required[fieldname] = {
                                value: field.value,
                                is_valid: false,
                                placeholder: field.attributes.placeholder !== 'undefined' ? '' : field.attributes.placeholder.value
                            }
                        }
                    });
                    form_fields.user_agent = navigator.userAgent;
                    saver.data.push(form_fields)
                }
            }
        }
    };
$(document).ready(function(){
    saver.init();
});

/**
 * Allows text inputs to display a placeholder message until it gets focus, at which point the input
 * is set to empty.
 *
 * This simulated the placeholder attribute in html5.
 * http://dev.w3.org/html5/spec/Overview.html#the-placeholder-attribute
 *
 * @copyright Clock Limited 2010
 * @license http://opensource.org/licenses/bsd-license.php New BSD License
 * @author Paul Serby <paul.serby@clock.co.uk>
 */
(function ($) {
	$.fn.placeholder = function (text) {

	return this.each(function () {

			var
				context = $(this),
				placeholderText,
				nativePlaceholderSupport = ('placeholder' in document.createElement('input'));

			function onBlur(event) {
				checkIfEmpty($(event.target));
			}

			function checkIfEmpty() {
				if (context.val() === '') {
					if (context.attr('type') === 'password') {
						try {
							context.attr('type', 'text');
						} catch(e) {
							return false;
						}
					}
					context.val(placeholderText);
					context.addClass('ui-placeholder');
				}
			}

			function onFocus(event) {
				context.removeClass('ui-placeholder');
				if (context.val() === placeholderText) {
					context.val('');
				}
			}

			if (text === undefined) {
				placeholderText = $(this).attr('placeholder');
			} else {
				placeholderText = text;
			}

			if (!nativePlaceholderSupport) {
				checkIfEmpty(context.blur(onBlur).focus(onFocus));
				context.parents('form').submit(function(event) {
					if (context.val() === placeholderText) {
						context.val('');
					}
				});
			} else {
				context.attr('placeholder', placeholderText);
			}
		});
	};
})(jQuery);

